"use strict";

//methods

function getfName() {
    var str = $("#fname").val();
    return str.charAt(0).toUpperCase() + str.slice(1);
};

function getlName() {
    var str = $("#lname").val();
    return str.charAt(0).toUpperCase() + str.slice(1);
};

function areValues() {
    if (id && fname && lname && department && image && email && phone) {
        $("#submit").prop("disabled", false);
    } else {
        if (!id || !fname || !lname || !department || !image || !email || phone) {
            $("#submit").prop("disabled", true);
        }
    }
};

function Employee() {
    var employee = {
        id: id,
        fname: fname,
        lname: lname,
        email: email,
        department: department,
        phone: phone,
        image: "/images/" + image,
        description: description
    };

    return employee;
}

function injectEmployee(employeeInput) {
    var url = "images/" + image;
    var newEmployee = "<div class=\"item-container\">\n                                <div class=\"item\">\n                                    <div class=\"overlay\">\n                                        <div class=\"profile-image-container\">\n                                            <img src=" + url + ">\n                                        </div>\n                                        <h3>" + fname + "</h3>\n                                        <h3 class=\"lname\">" + lname + "</h3>\n                                        <h4>" + department + "</h4>\n                                        <h5>" + email + "</h5>\n                                        <h6>" + phone + "</h6>\n                                        <button class=\"details\">details</button>\n                                    </div>\n                                    <img src=" + url + ">\n                                </div>\n                                <input type=\"hidden\" value=" + employeeInput.id + ">\n                            </div>";

    $(".row").append(newEmployee);
};

function getEmployeeData(modalId) {
    var employeeData;

    for (var i = 0; i < employeeList.length; i++) {
        if (employeeList[i].id === modalId) {
            employeeData = employeeList[i];
        }
    }
    return employeeData;
}

function openModal(modalId) {
    var employeeData = getEmployeeData(modalId);

    var modalEmployee = "<section class=\"modal\">\n                <div class=\"card\" id=\"card\">\n                    <div class=\"image-container\">\n                        <img src=" + employeeData.image + ">\n                    </div>\n                    <div class=\"employee-information\">\n                        <h3 class=\"modal-id\" value=" + employeeData.id + ">" + employeeData.id + "</h3>\n                        <h2 class=\"modal-fname\">" + employeeData.fname + "</h2>\n                        <h2 class=\"modal-lname\">" + employeeData.lname + "</h2>\n                        <h3>" + employeeData.department + "</h3>\n                        <h3>" + employeeData.email + "</h3>\n                        <h3>" + employeeData.phone + "</h3>\n                        <p>" + employeeData.description + "</p>\n                        <div class=\"icons\">\n                            <button class=\"action-btn export\">export</button>\n                            <button class=\"action-btn print\">print</button>\n                            <button class=\"action-btn delete\">delete</button>\n                        </div>\n                    </div>\n                    \n                </div>\n                <button id=\"close-modal\">close</button>\n            </section>";

    $("main").append(modalEmployee);
    document.getElementById("#card").addEventListener("animationend", openModalListener);
};

function openModalListener() {
    $(".employee-information").css("opacity", "1");
}

function removeEmployeeHtml(id) {
    var tileContainers = $("body").find(".item-container");

    for (var i = 0; i < tileContainers.length; i++) {
        var tileId = $(tileContainers[i]).attr("data-employeeId");

        if (tileId === id) {
            tileContainers[i].remove();
        }
    }
};

function removeEmployeeList(id) {
    var employeeIndex;
    for (var i = 0; i < employeeList.length; i++) {
        if (employeeList[i].id === id) {
            employeeIndex = i;
        }
    }

    if (id > -1) {
        employeeList.splice(employeeIndex, 1);
    }
}

function closeModal() {
    $("section").remove(".modal");
};
